import React from 'react'

const App = () => {
  return (
    <div className="container">
      <div className="row-auto place-content-end">
        <div className="col-auto justify-center">
          <h1 className="p-2">Hello World</h1>
          </div>
      </div>
    </div>
  )
}

export default App;
